export default function DrawBtn () {
  const [cls, setCls] = useState("green");

  return (
    <>
      <style>{".red {background-color: red; padding: 1%} .green {background-color: green; padding: 1%}"}</style>
      <button
        className={cls}
        onClick={() => setCls((cls) => (cls === "red" ? "green" : "red"))}
      >
        Button
      </button>
    </>
  );
}
